Name:         vl3-nse-example-config-map
Namespace:    wcm-system
Labels:       <none>
Annotations:  <none>

Data
====
config.yaml:
----
endpoints:
    - name: example
      labels:
        app: vl3-nse-example
        wcm/nsr.addr: example.nispatil-wcm-cisco.com
        wcm/nsr.port: "443"
      nseControl:
        name: example
        address: example.nispatil-wcm-cisco.com
        connectivityDomain: example
      vl3:
        ipam:
            defaultPrefixPool: 192.102.0.0/16
            serverAddress: wcmd-example.nispatil-wcm-cisco.com:443
            prefixLength: 22
            routes: []
        ifName: endpoint0
      awsTgwEndpoint:
        attachToTgw: false
        region: example-region
        subnetIDs:
            - example-subnet-IDs
        transitGatewayID: example-tgw-ID
        vpcID: example-vpc-ID

Events:  <none>

